import Header from '../atoms/Header/Header'

export default function Home(props) {
    return (
        <div>
            <Header />
            <div id="tab1" class="tabcontent">
                <h3>Movie Info</h3>
                <p>London is the capital city of England.</p>
            </div>

        </div>
    )

}
